import React from "react";
import { makeStyles } from '@material-ui/core/styles';
import Chip from '@material-ui/core/Chip';
import Button from '@material-ui/core/Button';
import Grid from '@material-ui/core/Grid';
import Divider from '@material-ui/core/Divider';
import Typography from '@material-ui/core/Typography';
import Link from '@material-ui/core/Link';
import Container from '@material-ui/core/Container';

const useStyles = makeStyles((theme) => ({
    root: {
      width: '100%',
      maxWidth: 720,
    },
    chip: {
      margin: theme.spacing(0.5),
    },
    section1: {
      margin: theme.spacing(3, 2),
    },
    section2: {
      margin: theme.spacing(2),
    },
    section3: {
      margin: theme.spacing(3, 1, 1),
    },
  }));

export default function Item() {
    const classes = useStyles();

    return (
        <Container component="main" maxWidth="xs">
            <div className={classes.root}>
                <Grid container alignItems="center">
                    <Link
                        component="button"
                        onClick={() => {
                        console.info("I'm a button.");
                        }}
                    >
                        Back to result
                    </Link>
                </Grid>
                <Divider variant="middle" /> 
                <figure class="iw multimage">
                    <div class="gallery">
                        <div class="swipe" >
                            <div class="seipe-wrap" ></div>
                        </div>
                        <div id="1_image_QJWpyWnmpl_0bC0fu" data-imgid="QJWpyWnmpl_0bC0fu" class="slide first visible" data-index="0" >
                            <img src="https://images.craigslist.org/00q0q_QJWpyWnmpl_0bC0fu_600x450.jpg" title="1" alt="1"></img>
                        </div>
                    </div>
                    </figure>       
            </div>
        
        </Container>
     
    );
}
